source.description:
Males shown on left hand side; females on right hand side. 
Red = no education;
Yellow = primary education;
Pale blue = secondary education;
Blue = tertiary education.


Source: IIASA-VID Dataset (W Lutz, A Goujon, S K.C., W Sanderson. 2007. Reconstruction of population by age, sex and level of educational attainment of 120 countries for 1970-2000. Vienna Yearbook of Population Research, vol. 2007, pp 193-235.)

